import React, { useState } from 'react';
import '../../Styles/login.css';

function LoginPage({loginAction,setLoginAction}) {
  const [isLogin, setIsLogin] = useState(true);
 
  const handleSignupClick = () => {
    setIsLogin(false);
  };

  const handleLoginClick = () => {
    setIsLogin(true);
  };

  const handleLogin=()=>{
     const formData = new FormData(form);
     const Email = formData.get('loginEmail');
     const Password  = formData.get('loginPassword');
  }
  const handleSignup=()=>{
    const formData = new FormData(form);
    const Name  = formData.get('Name');
    const Email = formData.get('Email');
    const Password  = formData.get('Password');
    fetch("http://localhost:9000/user/signup",
        {
            method:"POST",
            body:JSON.stringify({
                Name:Name,
                Email:Email,
                Password:Password
            })
        }
    ).then((resp)=>{
        alert(resp);
    }).catch((err)=>alert(err));

    setLoginAction(true);
 }
  return (
    <React.Fragment>
    <div className="wrapper">
      <div className="title-text">
        <div className={`title ${isLogin ? 'login' : 'signup'}`}>
          {isLogin ? 'Login Form' : 'Signup Form'}
        </div>
      </div>
      <div className="form-container">
        <div className="slide-controls">
          <input
            type="radio"
            name="slide"
            id="login"
            checked={isLogin}
            onChange={handleLoginClick}
          />
          <input
            type="radio"
            name="slide"
            id="signup"
            checked={!isLogin}
            onChange={handleSignupClick}
          />
          <label htmlFor="login" className="slide login" onClick={handleLoginClick}>
            Login
          </label>
          <label htmlFor="signup" className="slide signup" onClick={handleSignupClick}>
            Signup
          </label>
          <div className="slider-tab" style={{ left: isLogin ? '0%' : '50%' }}></div>
        </div>
        <div className="form-inner">
          {isLogin ? (
            <form className="login" onSubmit={handleLogin}>
              <div className="field">
                <input type="text" placeholder="Email Address" value="loginEmail" required />
              </div>
              <div className="field">
                <input type="password" placeholder="Password" value="loginPassword"required />
              </div>
              <div className="pass-link">
                <a href="#">Forgot password?</a>
              </div>
              <div className="field btn">
                <div className="btn-layer"></div>
                <input type="submit" value="Login"/>
              </div>
              <div className="signup-link">
                Not a member?{' '}
                <a href="#" onClick={(e) => { e.preventDefault(); handleSignupClick(); }}>
                  Signup now
                </a>
              </div>
            </form>
          ) : (
            <form className="signup" onSubmit={handleSignup}>
                <div className="field">
                <input type="text" placeholder="Name" value="Name" required />
              </div>
              <div className="field">
                <input type="text" placeholder="Email Address" value="Email" required />
              </div>
              <div className="field">
                <input type="password" placeholder="Password" value="Password" required />
              </div>
              <div className="field">
                <input type="password" placeholder="Confirm password" required />
              </div>
              <div className="field btn">
                <div className="btn-layer"></div>
                <input type="submit" value="Signup"  />
              </div>
            </form>
          )}
        </div>
      </div>
    </div>
    </React.Fragment>
  );
}

export default LoginPage;
